import BakewareBackground from '../routes/components/bakeware.jpg'; 
import './bakeware.css'; 
import NavbarComponents from '../components/navbar'; 

export default function Bakeware () {
    return (
        <div>
            <NavbarComponents />
            <div className='background-image-bakeware' style={{backgroundImage: {BakewareBackground}}}></div>
        </div>
    )
}
